snippet.textOriginal:
uh... a large chunk of what is said during the video is simply not true:
- the watch is dirty and has wear and tear;
- I am not saying that it's not a in very condition, however the watch has been used far more than the 2 / 3 times taken out to look at it that was mentioned;
- Consequently, the story appears to have been "beefed up" and the owner seemingly groomed and tidied up to look good on TV (and surely well after he knew that the watch was valuable).
